import React, { useEffect , useState } from 'react'
import { Table , Button } from 'antd';
import { connect } from 'react-redux';
import { homDatas } from '@/actions/home'


function Tab (props) {
  const { homDatas , list ,log } = props
  let obj ={
    username:log.userData.username,
    password:log.userData.password,
    token:log.token
  }
  useEffect (() => {
    homDatas(obj)
  }, [])

  const columns = [
    {
      title: '姓名',
      dataIndex: 'name',
      key: 'name'
    },
    {
      title: '年龄',
      dataIndex: 'age',
      key: 'age',
    },
    {
      title: '地址',
      dataIndex: 'address',
      key: 'address',
    },
    {
      title: 'Action',
      key: 'action',
      render: (text, record) => (
        <span>
          <Button>编辑</Button>
          <Button>删除</Button>
        </span>
      ),
    },
  ];
  const data = {

  }
  return (
    <div className="tables"> 

    {

      <Table rowKey="id" columns={columns} dataSource={list} />
    }

    </div>
  )

}

export default connect(({ fromData , loginData }) => {
  return {
    list: fromData.data,
    log: loginData.data.data
  }
},{
  homDatas
})(Tab)
